import React from 'react';
import './Footer.scss';

export function Footer () {
    return(
        <footer className="container-footer">
            <div className="row">
                <div className="col">
                    <a href="./LegalPage/">Política de protección de datos</a>
                </div>
                <div className="col"></div>
            </div>
        </footer>
    )
}
export default Footer;
